&nbsp;(061) 9.8448.7562 ou (019) 9.9172-0540 WhatsApp</p>','S'),(31,'vendas@vitalgarden.com.br','Alvaro Roberto Murbach','2016-09-12 00:00:00','<p>Srs, muito me apraz em poder contatar Vs. Ss., utilizando este canal de comunica&ccedil;&atilde;o.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Sou gerente comercial da Front Qu&iacute;mica Ltda, localizada em Charqueada, SP, e somos fabricantes de produtos que podem, dentro de Vs. interesses, vir agregar em sua linha comercial, e podendo aumentar seu faturamento, tendo em vista que nosso produto &eacute; de grande aceita&ccedil;&atilde;o no mercado.</p>\n<p>A Front qu&iacute;mica fabrica os famosos MAXXI GEL E MEGA GEL, produtos para controle de formigas e de baratas, respectivamente.&nbsp;</p>\n<p>Estou procurando empresa para fazermos uma parceria de bons neg&oacute;cios, e como n&atilde;o temos representantes e nem distribuidores nas regi&otilde;es que Voces atuam, pensamos em fazer uma visita em seu escrit&oacute;rio central e apresentar todo nosso portf&oacute;lio, claro se houver concord&acirc;ncia de Vossa parte. &nbsp;</p>\n<p>Estamos a sua disposi&ccedil;&atilde;o para quaisquer assuntos realtivos aos nossos produtos.</p>\n<p>Fique a vontade em visitar nossa p&aacute;gina: <a href=\"http://www.frontquimica.com.br\">www.frontquimica.com.br</a>. Ela est&aacute; passando por atualiza&ccedil;&otilde;es para acrescentarmos mais alguns produtos de nossa linha.</p>\n<p>&nbsp;</p>\n<p>Desde j&aacute; agrade&ccedil;o imensamente a oportunidade. &nbsp; &nbsp;</p>\n<p>&nbsp;</p>\n<p>Atenciosamente;</p>\n<p>&nbsp;</p>\n<p>&Aacute;lvaro&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;</p>','S'),(32,'douglasjose01@hotmail.com','douglas jose ferreira','2016-09-15 00:00:00','<p>boa tarde, sou de santo antonio da platina p r,liguei no fone 14 3378 9999 mais n&atilde;o consegui falar ,vendo selaria e me entere&ccedil;o na escova horse cod. 329 , qual pedido min. pre&ccedil;o , grato. douglas 14 9 97964320.</p>','S'),(34,'mmneto@vitopel.com','Mario Mazo