dil;os de Intelig&ecirc;ncia Comercial e meu objetivo atrav&eacute;s desse primeiro contato &eacute; apresentar nossos cases para S&atilde;o Francisco.</p>\n<p>Tem algum email que posso encaminhar uma apresnta&ccedil;&atilde;o ?</p>\n<p>&nbsp;</p>\n<p>Obrigada&nbsp;</p>\n<p>&nbsp;</p>','S'),(47,'carreiro@saofranciscobrasil.com.br','Raphael','2016-10-06 00:00:00','<p>teste</p>','S'),(48,'gersonvasques@uol.com.br','Gerson Vasques','2016-10-06 00:00:00','<p>Boa tarde,</p>\n<p>&nbsp;</p>\n<p>Por gentileza nos envie o contato do Representante que atende a cidade de Americana/SP.</p>\n<p>&nbsp;</p>\n<p>Grato.</p>','S'),(49,'vassourasmaranhao@hotmail.com','Maranhão Distribuidora','2016-10-06 00:00:00','<p>Boa tarde</p>\n<p>&nbsp;</p>\n<p>represento a empressa Maranh&atilde;o Distribuidora de Rondon&oacute;polis -MT.</p>\n<p>trabalho principalmente com a linha de limpesa e utilidades domesticas. teria como me mandar uma tabela de pre&ccedil;o dos seus produtos?</p>\n<p>&nbsp;</p>\n<p>M&aacute;rio</p>','S'),(53,'as_bauru@hotmail.com','antonio da silva ','2016-10-07 00:00:00','<p>Boa Tarde . tenho um bazar aqui em bauru que estou regularizando&nbsp; , e reabrindo pois ja o tenho funcionando a mais de dose anos</p>\n<p>gostaria se&nbsp; puderem pasar para o vendedor da area de bauru o meu endere&ccedil;o para uma visita</p>\n<p>Antonio da Silva</p>\n<p>Alameda Vista Alegre N&ordm; 1-50</p>\n<p>Parque vista Alegre</p>\n<p>Bauru&nbsp;&nbsp; Sp</p>\n<p>Essa rua fica atras da z pneus no entroncamento da nacoes unida com a nuno de assis&nbsp; prox. ao terminal rodoviario</p>\n<p>ao lado do escritorio timoneiro</p>','S'),(54,'tudopracasa.loja@gmail.com','Helio Costa','2016-10-10 00:00:00','<p>Favor informar representante e ou distribuidor de seus produtos para S&atilde;o Paulo-Capital.</p>\n<p>Telefone (11)55713791</p>','S'),(55,'maxilimp@maxilimp.com','Felipe Selingardi','2016-10-11 00:00:00','<p>Boa Tarde,</p>\n<p>&nbsp;</p>\n<p>Meu nome &eacute; Felipe, sou representante de compr