','2016-10-26 00:00:00','<p>Comprei esponja Esfregmax c&oacute;digo 023 embalagen com duas unidades para lavar lou&ccedil;as. Sempre comprei a de cor laranja, um produto de excelente qualidade (dura mais de m&ecirc;s). &nbsp;Desta vez peguei a de cor vermelha, tamb&eacute;m do c&oacute;digo 023, e notei que esta (vermelha )\' durou apenas tr&ecirc;s dias. Gostaria de saber o motivo da diferen&ccedil;a de qualidade dos produtos, j&aacute; que parecem ser os mesmos produtos, diferenciando apenas na cor. A esponja laranja dura mais de trinta dias e a vermelha dura apenas 3 dias, ser&aacute; o corante utilizado?</p>','S'),(63,'rgonzagaprado@gmail.com','Roberto Gonzaga do Prado','2016-10-31 00:00:00','<p>Prezada Sra Cristina,</p>\n<p>&nbsp;</p>\n<p>Em busca de nova proposta de trabalho na &aacute;rea comercial, apresento-lhes meu curr&iacute;culo anexo.</p>\n<p>Entre minhas caracter&iacute;sticas b&aacute;sicas encontram-se: adaptabilidade, bom humor, dinamismo, responsabilidades, perfeccionismo, auto-exig&ecirc;ncia, dedica&ccedil;&atilde;o ao trabalho e bom relacionamento em geral.</p>\n<p>Informo ainda que tenho disponibilidade para viagens, de acordo com a necessidade da organiza&ccedil;&atilde;o.</p>\n<p>No aguardo de contato de sua parte, coloco-me &agrave; disposi&ccedil;&atilde;o para prestar-lhes mais esclarecimentos.</p>\n<p>Atenciosamente,</p>\n<p>&nbsp;</p>\n<p>Roberto Gonzaga do Prado</p>\n<p>contato (011) 9 9645-0113</p>\n<p>&nbsp;</p>\n<p><strong>ROBERTO GONZAGA DO PRADO</strong></p>\n<p>&nbsp;</p>\n<p>Contato: (11) 9 9645-0113&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Email: <a href=\"mailto:rgonzagaprado@gmail.com\">rgonzagaprado@gmail.com</a>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Idade: 54</p>\n<p>&nbsp;</p>\n<p>Endere&ccedil;o: Rua Maria Jose de Morais, 133 &ndash; Butanta - SP</p>\n<p>&nbsp;<strong><u>Objetivo</