mpatia, m&aacute;ximo,produtor essas regionais.</p>\n<p>Tbem varejo em geral regi&atilde;o do vale Para&iacute;ba com prepostos parceiros gerenciados por mim.(farinha de trigo, latic&iacute;nio podem atuar tbem com seus produtos.</p>\n<p>Sul de MG .</p>\n<p>Rede Alvorada, Baronesa,entre outras tbem.</p>\n<p>Quero saber se voc&ecirc;s teem interesse em cadastrar seus produtos em alguns clientes de nossa carteira.</p>\n<p>Aguardo um breve retorno .</p>\n<p>Conhe&ccedil;o seus produtos e sei que d&aacute; para fazer um &oacute;timo trabalho na regi&atilde;o onde atendemos.</p>\n<p>Att.</p>\n<p>Paulo</p>\n<p>&nbsp;</p>','N'),(477,'escovabras01@bol.com.br','JOSÉ RICARDO Rezende','2020-12-20 00:00:00','<p style=\"padding-left: 60px;\">Pre&ccedil;o&nbsp; &nbsp;escova&nbsp; ref.&nbsp; 380&nbsp; &nbsp;e&nbsp; 370&nbsp; . A vista&nbsp; sem c&oacute;digo de barra .Pre&ccedil;o&nbsp; para&nbsp; 300 dz.&nbsp; &nbsp;Por&nbsp; exemplo&nbsp; se a base&nbsp; &eacute;&nbsp; azul&nbsp; &nbsp;nailon&nbsp; amarelo&nbsp; laranja&nbsp; rosa . Diferen&ccedil;a de pre&ccedil;o se a base for preta&nbsp; . Na&nbsp; base preta&nbsp; nailon&nbsp; amarelo&nbsp; rosa&nbsp; laranja&nbsp; . Pre&ccedil;os&nbsp; ....</p>','N'),(478,'roney.oliveira@simplessystem.com.br','Roney Tinetti','2021-01-19 00:00:00','<p>Boa tarde!!!</p>\n<p>&nbsp;</p>\n<p>Meu nome &eacute; Roney, sou consultor de vendas da empresa <strong>Simples System</strong>, representante das impressoras inglesas LINX e dos envolvedores para estabiliza&ccedil;&atilde;o de cargas paletizadas, a ROBOPAC; estou lhe enviando uma apresenta&ccedil;&atilde;o de nossa empresa, com todos os benef&iacute;cios e oportunidades. Caso tenha interesse, estamos &agrave; disposi&ccedil;&atilde;o para atend&ecirc;-los prontamente.</p>\n<p>A <strong>Simples System</strong>, &eacute; uma empresa especializada em solu&ccedil;&otilde;es industriais, temos como objetivo desenvolver solu&ccedil;&otilde;es e eliminar perdas financeiras no ambiente industrial, atendendo toda linha de produtos com necessidades simples ou aplica&ccedil;&otilde;es especiais.</p>\n<p>A <strong>Simples System</strong> Juntamente com a LINX e a ROBOPAC, tem como objetivo oferecer aos nossos clientes/parceiros a maior efici&ecirc;ncia dos equipamentos, o menor custo de propriedade e o melhor atendimento pessoal e tecnol&oacute;gico, fato este que comprova a efici&ecirc;ncia e qualidade dos produtos que ofertamos aos nossos parceiros e clientes.</p>\n<p>Nossa empresa conta com uma &aacute;rea de engenharia especializada em tecnologias industriais, equipe t&eacute;cnica altamente treinada, com capacidade de atender com excel&ecirc;ncia todos os requisitos voltados aos equipamentos oferecidos.</p>\n<p>Somos Distribuidores das marcas mais conceituadas do mundo, descri&ccedil;&otilde;es abaixo.</p>\n<p>A LINX &eacute; uma empresa Inglesa, reconhecida mundialmente como uma das empresas de maior tecnologia em codifica&ccedil;&atilde;o e marca&ccedil;&atilde;o, principalmente por desenvolver impressoras e codificadores altamente tecnol&oacute;gicos, projetados para aumentar a produtividade, por&eacute;m com grande foco na redu&ccedil;&atilde;o de custos das organiza&ccedil;&otilde;es. O desenvolvimento desses equipamentos segue padr&otilde;es rigorosos de qualidade, garantindo efici&ecirc;ncia e total seguran&ccedil;a em sua funcionalidade nos mais diversos ambientes de produ&ccedil;&atilde;o.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Ink jet (CIJ - Jato de Tinta Cont&iacute;nuo)</strong><br /> <br /> Possu&iacute;mos o melhor custo-benef&iacute;cio do mercado,</p>\n<p>oferecendo mais valor pelo seu dinheiro, sem surpresas</p>\n<p>com custos ocultos, atrav&eacute;s de sistemas inteligentes de manuten&ccedil;&atilde;o</p>\n<p>e as melhores taxas de disponibilidade do mercado.</p>\n<table width=\"265\">\n<tbody>\n<tr>\n<td>\n<p><strong>Alta Resolu&ccedil;&atilde;o (LCM - Piezo)</strong><br /> <br /> Equipamentos dedicados &agrave;s embalagens secund&aacute;rias (papel&atilde;o ondulado, por exemplo). Permitem grandes taxas de redu&ccedil;&atilde;o de custos, principalmente atrav&eacute;s de substitui&ccedil;&atilde;o de etiquetas, atrav&eacute;s de marca&ccedil;&otilde;es de alt&iacute;ssima resolu&ccedil;&atilde;o para impress&atilde;o de c&oacute;digos de barras, logotipos e demais informa&ccedil;&otilde;es vari&aacute;veis.</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>A ROBOPAC &eacute; uma empresa Italiana, l&iacute;der mundial na constru&ccedil;&atilde;o de m&aacute;quinas e sistemas para estabiliza&ccedil;&atilde;o de cargas paletizadas, h&aacute; mais de 17 anos presente no Brasil, atrav&eacute;s de distribuidores com servi&ccedil;os especializados de assist&ecirc;ncia t&eacute;cnica.</p>\n<table width=\"77%\">\n<tbody>\n<tr>\n<td width=\"100%\">\n<p>Envolvedor Rob&ocirc; S6</p>\n<p>&nbsp;</p>\n<p>O Rob&ocirc; S6 tem a capacidade de embalar qualquer tipo de produto, forma ou dimens&atilde;o, al&eacute;m disso, gra&ccedil;as &agrave; inibi&ccedil;&atilde;o do sistema eletr&ocirc;nico contador de arestas &eacute; poss&iacute;vel envolver tamb&eacute;m produtos de forma cil&iacute;ndrica.</p>\n</td>\n</tr>\n</tbody>\n</table>\n<table width=\"859\">\n<tbody>\n<tr>\n<td>\n<p>N&oacute;s trabalhamos com os melhores equipamentos do mundo e podemos provar isso.</p>\n<p>Acesse o nosso site:-</p>\n<p><a href=\"http://www.simplessystem.com.br\">www.simplessystem.com.br</a></p>\n<p><a href=\"http://www.linxglobal.com\">www.linxglobal.com</a></p>\n<p><a href=\"http://www.robopac.com.br\">www.robopac.com.br</a></p>\n<p>&nbsp;</p>\n<p>Muito obrigado pela aten&ccedil;&atilde;o despendida at&eacute; o momento. Caso queiram podemos agendar uma visita sem compromisso.</p>\n<p>&nbsp;</p>\n<p>Atenciosamente,</p>\n<p>&nbsp;</p>\n<p>Roney Tinetti</p>\n<p>Consultor de vendas &ndash; (14) 33180838</p>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>','N'),(479,'facilitte@hotmail.com','Marilda Aparecida Pedrão','2021-01-24 00:00:00','<p>