.</p>\n<p>No aguardo de um retorno, desde j&aacute; agrade&ccedil;o a aten&ccedil;&atilde;o.</p>\n<p>Muito Obrigado</p>\n<p>EDUARDO PERES</p>\n<p>E.P. REPRESENTA&Ccedil;&Otilde;ES COMERCIAIS.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','N'),(535,'mauricio.madeiras@hitmail.com','Mauricio','2021-09-19 00:00:00','<p>Bom dia, adquiri um rodo duplo de madeira 60 cm, estou concluindo uma obra e como aqui temos ambientes razoavelmente grandes, &nbsp;vi a necessidade de ter um rodo maior que o convencional.</p>\n<p>O seu produto est&aacute; bem bacana funcionou perfeitamente para a minha proposta, s&oacute; que quando a sua equipe de engenharia projetou o rodo, n&atilde;o levou em conta que, devido ele ter o cabo mais comprido tamb&eacute;m deveria ser numa bitola maior, tipo com uns 3 cm de di&acirc;metro.</p>\n<p>Logo &nbsp;no in&iacute;cio da limpeza ele quebrou, ainda que eu trabalhe com madeira, vou consertar....mas imagina uma dona de casa exigente leva o rodo para a funcion&aacute;ria e ao usar quebre o cabo, vai ser um transtorno para solucionar a quest&atilde;o.</p>\n<p>Quanto &nbsp;da cr&iacute;tica do produto &eacute; uma cr&iacute;tica construtiva.</p>\n<p>Hoje mais que ontem podemos melhorar sempre.</p>\n<p>Trabalhamos com madeira e sabemos da dificuldade em ajustar o uso adequado.</p>\n<p>Caso queira conhecer nossos trabalhos acesse nossa p&aacute;gina Instagram e Facebook.</p>\n<p>&nbsp;</p>\n<p>mauricioagromadeiras&nbsp;</p>\n<p>Avare.</p>','N'),(536,'antoniomarceloa@gmail.com','ANTONIO MARCELO DE ALMEIDA LIMA','2021-09-21 00:00:00','<p>BOM DIA!</p>\n<p>&nbsp;</p>\n<p>SOU REPRESENTANTE COMERCIAL NORTE BAHIA E SERT&Atilde;O PERNAMBUCO E TENHO MINHA EMPRESA COMERCIAL, ONDE REVENDO PARA PEQUENOS VAREJOS.</p>\n<p>LINHA EXCELENTE.</p>\n<p>TENHO INTERESSE.</p>\n<p>PODEMOS REALIZAR EXCELENTE TRABALHO COM DISTRIBUIDORES.</p>\n<p>AGUARDO</p>\n<p>MARCELO ALMEIDA</p>\n<p>(87)9 96015800</p>','S'),(537,'antoniomarceloa@gmail.com','ANTONIO MARCELO DE ALMEIDA LIMA','