de;o.</p>\n<p>Att.,</p>','S'),(630,'corralonelcabildo@hotmail.com','Cuenca arredondo jesica','2025-05-29 00:00:00','<p style=\"text-align: right;\">Buenos d&iacute;as,soy de Salta Argentina. Estoy interesada en su cat&aacute;logo de venta. Podr&iacute;a darme informaci&oacute;n.</p>','S'),(631,'luciennefranco@hotmail.com','lucienne','2025-06-12 00:00:00','<p>Boa tarde</p>\n<p>Gostaria de informa&ccedil;&otilde;es sobre os produtos, como tabela de pre&ccedil;os e quantidade m&iacute;nima de compra, pois tenho uma loja na cidade de Piraju</p>\n<p>Desde ja agrade&ccedil;o a aten&ccedil;&atilde;o e aguardo um retorno</p>\n<p>&nbsp;</p>\n<p>Lucienne</p>\n<p>&nbsp;</p>','S'),(632,'ourinhosbasqueteaabo@gmail.com','Beth Bressanin','2025-06-17 00:00:00','<p><strong>A Associa&ccedil;&atilde;o Atl&eacute;tica Basquete Ourinhos (AABO) &eacute; uma organiza&ccedil;&atilde;o da sociedade civil, sem fins lucrativos, reconhecida como de utilidade p&uacute;blica municipal pela Lei n&ordm; 6.977/2024, com atua&ccedil;&atilde;o regular e transparente, sendo detentora do CRCE (Certificado de Regularidade Cadastral de Entidades) do Governo do Estado de S&atilde;o Paulo e do CRC (Certificado de Registro Cadastral 18 18-A) do Minist&eacute;rio do Esporte. Atuamos com excel&ecirc;ncia na promo&ccedil;&atilde;o do basquete feminino como ferramenta de forma&ccedil;&atilde;o esportiva, inclus&atilde;o social e empoderamento da mulher, contribuindo para o fortalecimento de v&iacute;nculos familiares e comunit&aacute;rios por meio do esporte.</strong></p>\n<p><strong><strong>&nbsp;</strong></strong></p>\n<p><strong><strong>Fundada em 5 de dezembro de 2021, a AABO surgiu da necessidade de resgatar o legado esportivo de Ourinhos, cidade reconhecida nacionalmente entre 1997 e 2014 como Capital Nacional do Basquete Feminino. Desde ent&atilde;o, temos reconstru&iacute;do esse patrim&ocirc;nio esportivo e social, unindo alto rendimento e impacto comunit&aacute;rio, com a oferta de servi&ccedil;os de conviv&ecirc;ncia e fortalecimento de v&iacute;nculos (SCFV) no &acirc;mbito da prote&ccedil;&atilde;o social b&aacute;sica, sempre em di&aacute;logo com o SUAS e os conselhos de direitos locais.</strong></strong></p>\n<p><strong><strong>&nbsp;</strong></strong></p>\n<p><strong><strong>Convidamos o &ldquo;Grupo S&atilde;o Francisco&rdquo; a caminhar conosco nesse prop&oacute;sito transformador, por meio do apoio aos nossos projetos esportivos e sociais, muitos deles aprovados em leis de incentivo fiscal como a Lei Federal e a Lei Paulista de Incentivo ao Esporte. Ao investir na AABO, sua marca se associa a valores como responsabilidade social, inclus&atilde;o e desenvolvimento humano, contribuindo diretamente para a forma&ccedil;&atilde;o cidad&atilde; de crian&ccedil;as, adolescentes e mulheres de Ourinhos e regi&atilde;o. Juntos, podemos fortalecer o esporte como pol&iacute;tica p&uacute;blica e como ferramenta de impacto real na vida das pessoas.</strong></strong></p>','S'),(633,'heberpina53@gmail.com','Heber Pina','2025-06-17 00:00:00','<p>Solicito or&ccedil;amento para 10.000 unidades de ESPONJA, para banho, em espuma, dimens&otilde;es: 110 mm x 60 mm x 20 mm. Frete para Salvador, Bahia.</p>','S'),(634,'acmbruno4@gmail.com','Antonio Bruno','2025-07-26 00:00:00','<p>Bom dia!<br />Tudo bem?<br />Gostaria de registrar que comprei um desentupidor sanit&aacute;rio c&oacute;digo 0640 da S&atilde;o Francisco no supermercado Tauste de Jundia&iacute;/SP e o mesmo apresenta uma caracter&iacute;stica que o inabilita para a fun&ccedil;&atilde;o.<br />Apesar de ter uma apar&ecirc;ncia OK, quando se faz a press&atilde;o, ele n&atilde;o retorna, fica achatado, n&atilde;o retornando &agrave; posi&ccedil;&atilde;o original e n&atilde;o criando o v&aacute;cuo.</p>\n<p>At.te.<br />Bruno</p>\n<p>&nbsp;</p>','S'),(635,'gaby_ghs@hotmail.com','Gabriela Helena Santos Aloizio','2025-08-02 00:00:00','<p>Bom dia!</p>\n<p>Escrevo &agrave; voc&ecirc;s devido ao produto que eu comprei no Supermercado Tauste em Campinas. Sempre consumimos os sacos de lixo da marca de voc&ecirc;s por serem fortes e resistentes. No entanto, o &uacute;ltimo pacote que compramos vem apresentando uma qualidade inferior, acredito que seja no corte entre um saco e outro, mas o fato &eacute; que os sacos est&atilde;o rasgando no fundo, com o m&iacute;nimo de utens&iacute;lios depositados, o que tentei usar no dia de hoje j&aacute; estava completamente aberto no fundo, por isso decidi escrever.&nbsp;<br />Gostaria de saber se algo pode ser feito? Me disponho a enviar o produto para an&aacute;lise de voc&ecirc;s. Enviarei fotos tamb&eacute;m para que voc&ecirc;s observem o que de fato acontece.</p>\n<p>Desde j&aacute; agradecemos.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','N'),(637,'fh480723@gmail.com','Fábio Henrique Dias Santos','2025-08-06 00:00:00','<p><strong>bom dia queria saber como eu poderia estar enviando em PDF meu curr&iacute;culo&nbsp;</strong></p>','N'),(638,'claudineymathiasrodeio@gmail.com','Claudinei Mathias','2025-09-03 00:00:00','<p>Gostaria de saber o valor do rodo grande usado em posto de combust&iacute;vel, sou de rancharia e j&aacute; a algum tempo eu uso esse rodo de voc&ecirc;s&nbsp;</p>','N'),(639,'marcinhafox@gmail.com','Márcia Aparecida dos Santos','2025-09-12 00:00:00','<p>Bom dia, tudo bem? Por gentileza, gostaria de informar um problema que tive quando comprei 01 pacote de sacos de lixo de 15 litros, da marca H&eacute;rcules e perdi por volta de 06 sacos, por estarem com os fundos abertos. Obrigada pela aten&ccedil;&atilde;o.</p>','N'),(640,'prtuliosouza@gmail.com','Túlio de Souza','2025-09-16 00:00:00','<p>Boa tarde, gostaria de saber se est&atilde;o precisando de representante comercial na regi&atilde;o de Catanduva/SP, se sim, me coloco a disposi&ccedil;&atilde;o, tenho uma linha de clientes j&aacute;. Obrigado, aguardo retorno&nbsp;</p>','N'),(641,'dudielfrutas123@gmail.com','Ediel de Oliveira ','2025-09-22 00:00:00','<p>PRECISO DE OR&Ccedil;AMENTO PARA MONTAR KITS DE VASSOURA, RODO E P&Aacute;,&nbsp; O MAIS BARATO QUE VOC&Ecirc;S TEM . SOU DO PARAN&Aacute;.</p>\n<p>&nbsp;</p>','N'),(642,'jrpgoncalves@bol.com.br','José Roberto Pimenta Gonçalves','2025-09-23 00:00:00','<p>Preciso fazer uma.compra n&atilde;o consigo falar a&iacute; por favor me ligue&nbsp;</p>','N'),(643,'julianalippi65@gmail.com','juliana kelen lippi','2025-09-23 00:00:00','<p>BOA TARDE</p>\n<p>&nbsp;</p>\n<p>GOSTARIA DE FAZER CADASTRO PARA COMPRA COM VO&Ccedil;ES.</p>\n<p>AGUARDO UM RETORNO.</p>','N'),(644,'jrpgoncalves@bol.com.br','José Roberto Pimenta Gonçalves','2025-09-24 00:00:00','<p>Ja sou cliente&nbsp; moro em Franca SP seu representante n&atilde;o atende&nbsp;</p>\n<p>Pedido&nbsp;</p>\n<p>Vassoura animal&nbsp; manda pra min 48 pe&ccedil;as</p>\n<p>Pre&ccedil;o por favor&nbsp;</p>\n<p>Meu CNPJ 134308930001-57</p>','N'),(645,'jrpgoncalves@bol.com.br','José Roberto Pimenta Gonçalves','2025-09-24 00:00:00','<p>Ja sou cliente&nbsp; moro em Franca SP seu representante n&atilde;o atende&nbsp;</p>\n<p>Pedido&nbsp;</p>\n<p>Vassoura animal&nbsp; manda pra min 48 pe&ccedil;as</p>\n<p>Pre&ccedil;o por favor&nbsp;</p>\n<p>Meu CNPJ 134308930001-57</p>','S'),(646,'edmilson.mcosta@hotmail.com','Edmilson martins costa ','2025-10-29 00:00:00','<p>Bom dia&nbsp;</p>\n<p>&nbsp;</p>\n<p>sou representante comercial em sao paulo - capital e atendo lojas de utilidades nao vejo produtos sao francisco &nbsp;nesse segmento , gostaria de saber se a empresa tem o interesse de desenvolver um trabalho neste segmento&nbsp;</p>\n<p>&nbsp;</p>\n<p>att</p>\n<p>Edmilson&nbsp;</p>','N'),(647,'lucinhaoda80@gmail.com','Lucia Oda','2025-11-02 00:00:00','<p>Bom dia gostaria de saber o valor do rodo ref 245 de 60 cm e como posso compra-lo , preciso de 12 unidades . Obrigada!</p>','N'),(648,'lucinhaoda80@gmail.com','Lucia Oda','2025-11-02 00:00:00','<p>Bom dia gostaria de saber o valor do rodo ref 245 de 60 cm e como posso compra-lo , preciso de 12 unidades . Obrigada!</p>','N'),